import React, { useState, useEffect } from "react";
//import { Tabs } from "antd";
import "bootstrap/dist/css/bootstrap.min.css";
import "./users.css";
import axios from "axios";


const Users = () => {
  

  return (
    <div className="row">
      <div className="col-md-12">
        <table className="table table-bordered table-light">
          <thead className="bs">
            <tr>

              <th>ID</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Designation</th>
              <th>Contact</th>
              <th>User Name</th>
              <th>User Role</th>
              <th>Company Name</th>

            </tr>
          </thead>
          <tbody>
            {users.length > 0 ? (
              users.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>{user.
                    firstName}</td>
                  <td>{user.
                    lastName}</td>
                  <td>{user.
                    designation}</td>
                  <td>{user.
                    contact}</td>
                  <td>{user.
                    username}</td>
                  <td>{user.

                    selectedOption}</td>
                  <td>{user.


                    companyName}</td>

                  <td>
                    <button
                      className="btn btn-primary btn-sm me-2"
                      onClick={() => handleEdit(user)}
                    >
                      Update
                    </button>

                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" className="text-center">
                  No user Data Available
                </td>
              </tr>
            )}
          </tbody>
        </table>

        {/* Edit Modal */}
        {showEditModal && editingUser && (
          <users
            show={showEditModal}
            onClose={() => setShowEditModal(false)}
            user={editingUser}
            onUpdate={handleUpdate}
          />
        )}
      </div>
    </div>
  );
}
export default Users
